import React from "react";
import { Typography, Box, Button, Avatar } from "@material-ui/core";
import { Formik } from "formik";

const Index = () => {
  return (
    <div>
      <Box
        style={{
          textAlign: "center",
          height: "50vw",
          backgroundColor: "#ffffff",
        }}
      >
        <Typography>Log in </Typography>
      </Box>
    </div>
  );
};
export default Index;
